        dispatch(fun.displayDataInitial())
    }, [])

    return(
        <div>
            <stylCls.MainDiv>
                <CustomerHeader 
                    customerAddPay
                />
                <CustomerStatusbar 
                    customerAccount
                />
                <AddPayTabs
                    customerAddPay
